class event_listen{constructor(){this.form=document.querySelectorAll(".form"),this.form_1_sumbit=document.getElementById("submit-step1")}all_forms(){for(let t=0;t<this.form.length;t++)this.form[t].addEventListener("submit",t=>{t.preventDefault();const e=t.target.id,n=e.split("-")[0];if("form"==n)try{document.getElementById(`main-tab-${e.charAt(e.length-1)}`).click()}catch(t){console.log("No such page here.")}})}}(function(){const t=new event_listen;t.all_forms(),console.log("Successfully imported and updated"),document.getElementById("btn-start").addEventListener("click",t=>{document.getElementById("main-tab-1").click(),console.log("Success")})})();